def find_largest_divisible_by_6(A: str) -> str:
    a = [int(c) for c in A]
    asu = sum(a)
    amod = asu * 3
    if a[-1] % 2 != 0:
        if a[-2] % 2 == 0:
            adiv3 = amod - a[-1]
            if adiv3 == 0 or adiv3 == -3 or adiv3 == -6 or (adiv3 == -9):
                return A[:-1]
            else:
                return '-1'
        else:
            return '-1'
    else:
        max1 = -1
        for i in range(1, len(a) - 1):
            adiv3 = amod - a[i]
            if adiv3 == 0 or adiv3 == -3 or adiv3 == -6 or (adiv3 == -9):
                max1 = i
                if a[i + 1] > a[i]:
                    break
        adiv3 = amod - a[-1]
        if a[-2] % 2 == 0:
            if adiv3 == 0 or adiv3 == -3 or adiv3 == -6 or (adiv3 == -9):
                if max1 == -1 or a[max1] > a[max1 + 1]:
                    max1 = len(a) - 1
        adiv3 = amod - a[0]
        if adiv3 == 0 or adiv3 == -3 or adiv3 == -6 or (adiv3 == -9):
            if max1 == -1 or a[1] > a[0]:
                max1 = 0
        if max1 == -1:
            return '-1'
        else:
            return A[0:max1] + A[max1 + 1:]

